import Grid from '@material-ui/core/Grid'
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import React from 'react'

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },

}));

class Index extends React.Component
{
    constructor()
    {
        const classes = useStyles();
    }
    
  render()
  {
      return(
        <div>
        <Grid container spacing={3}>
            <Grid item xs={12}>
                <Paper><img src='static/img/frontpage1.jpg'></img></Paper>
            </Grid>
            <Grid item xs={6}>
                <Paper>xs=6</Paper>
            </Grid>
            <Grid item xs={6}>
                <Paper >xs=6</Paper>
            </Grid>
            <Grid item xs={3}>
                <Paper >xs=3</Paper>
            </Grid>
            <Grid item xs={3}>
                <Paper >xs=3</Paper>
            </Grid>
            <Grid item xs={3}>
                <Paper >xs=3</Paper>
            </Grid>
            <Grid item xs={3}>
                <Paper >xs=3</Paper>
            </Grid>
        </Grid>
    </div>
      )
  }
}

export default Index;
